import React from "react";
import { Button, Grid, TextField } from "@mui/material";

export const Sam = () => {
  return (
    <div>
      <Grid container spacing={2}>
        <Grid item xs={3}>
          <TextField variant="outlined" fullWidth />
        </Grid>
        <Grid item x={3}>
          <Button variant="contained" fullWidth>
            Add
          </Button>
        </Grid>
      </Grid>
    </div>
  );
};
